import React from "react";
import {
  IconDeath,
  IconRecovery,
  IconPositive,
  IconSpinner,
} from "../Icon/IconList";

const ContentApiDetails = ({ covidDetails, loadingIcon }) => {
  const { TotalPositive, TotalDeath, TotalRecovered } = covidDetails;
  return (
    <div>
      <ul>
        <li>{loadingIcon ? <IconSpinner /> : TotalPositive}</li>
        <li>{loadingIcon ? <IconSpinner /> : TotalDeath}</li>
        <li>{loadingIcon ? <IconSpinner /> : TotalRecovered}</li>
      </ul>
    </div>
  );
};

export default ContentApiDetails;
